import Name from './Name';

function Survey() {
  return(
    <div className="container">
      <Avatar name="Valentina Jaramillo" round={true}
      style={{border: 'solid 2px #39C463'}} />
      <button>Login</button>
    </div>
  )
}
export default Survey;
